import gsap from "gsap"

const navTl = gsap.timeline({
    duration: {default: 0.2}
})


export const openNav = ()=>{
    navTl.fromTo('.navBox', {
        duration: 0.2,
        opacity: 0,
        display: "none"
    }, {
        duration: 0.2,
        opacity: 1,
        display: "grid"
    })
}

export const closeNav = ()=>{
    navTl.reverse()
}
